import React from "react";
import images from "../components/utilities/images";
import ContainerTheme from "../components/utilities/themes/Container";

const Homepage = () => {
  return (
    <ContainerTheme>
      <div>
        <header>
          <h1>Edgar Cuarezma</h1>
        </header>
        <img src={`../images/home/${images.home}`} />
        <h2>Fine Art Illustration</h2>
      </div>
    </ContainerTheme>
  );
};

export default Homepage;
